import { Modal, Button } from "semantic-ui-react";

export const NewNadeGfycatModal = () => {
  return (
    <Modal trigger={<Button>Add</Button>} size="mini">
      <Modal.Header>Add gfycat video</Modal.Header>
      <Modal.Content image>
        <p>Hello</p>
      </Modal.Content>
    </Modal>
  );
};
